import React from 'react';

const Testimonials = () => {
  return (
    <section id="testimonials" className="section">
      <h2>What People Say</h2>
      <div className="testimonial-box">
        <div className="testimonial">
          <p>"Thulani's web development skills are exceptional! The project exceeded our expectations."</p>
          <p><strong>- Omphile Rantswele, Tech Champ</strong></p>
        </div>
        <div className="testimonial">
          <p>"I highly recommend Thulani. Their ability to design and develop is top-notch!"</p>
          <p><strong>- Brandon September, Tech Champ</strong></p>
        </div>
      </div>
    </section>
  );
};

export default Testimonials;
